import React from 'react';
import Product from './Product';
import './ProductList.css';

const ProductList = () => {
  const products = [
    {
      id: 1,
      name: 'Apple iPhone 14',
      price: 79999,
      imageUrl: 'https://store.storeimages.cdn-apple.com/4668/as-images.',
    },
    {
      id: 2,
      name: 'Samsung Galaxy S22',
      price: 69999,
      imageUrl: 'https://www.bing.com/images/search?q=Samsung+S22+Ultra+Logo&FORM=IRIBIP',
    },
    {
      id: 3,
      name: 'Sony WH-1000XM4 Headphones',
      price: 24999,
      imageUrl: 'https://th.bing.com/th/id/OIP.nlmxOoBLSywEalpOd6sKXwHaHa?w=167&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7',
    },
    // Add more products here
  ];

  return (
    <div className="productList">
      {products.map((product) => (
        <Product
          key={product.id}
          id={product.id}
          name={product.name}
          price={product.price}
          imageUrl={product.imageUrl}
        />
      ))}
    </div>
  );
};

export default ProductList;
